import React, { Component } from 'react';
import axios from "axios";

class Banner extends Component{
    constructor(props) {
        super(props);

    }

    render(){
        return(
            <div className="banner">
                <div>
                    {
                        axios.get('http://localhost:3000/banner?type=0')
                            .then((value)=>{
                                console.log(value)
                            })
                            .catch((error)=>{
                                console.log(error)
                            })
                    }
                </div>
            </div>
        )
    }
}

export default Banner;
